window.bookSummaryJSON = "<p><b>Looks can be deceiving. A fact sometimes learned at the pointy end of a blade. </b></p> <p><b>It makes for a very short learning curve.</b> </p> <p>Underestimating an opponent is a common mistake made by people wielding power. And when the most elite sect of assassins are involved, that blunder could prove to be a particularly fatal one. In times of subterfuge and plotting, though, it is clear they are not the only ones with tricks up their sleeves, and sometimes death is a two-way street. </p>"; 
